// Register.js
import React, { useState } from "react";
import { registerUser } from "./ApiCalls"; // Adjust the import path based on your project structure

const Register = () => {
  const [fname, setFname] = useState("");
  const [lname, setLname] = useState("");
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [accountType, setAccountType] = useState(""); // Updated state for account type
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      // Create user data object, ensuring the keys match the backend model
      const userData = {
        fname,
        lname,
        username,
        email,
        password,
        phone_number: phoneNumber, // Ensure this key matches your FastAPI model
        account_type: accountType, // This must match the enum values ('personal' or 'business')
      };

      console.log(userData); // eslint-disable-next-line
      const response = await registerUser(userData);

      // Set success message and clear inputs
      setSuccess("Registration successful! You can now log in.");
      setFname("");
      setLname("");
      setUsername("");
      setEmail("");
      setPassword("");
      setPhoneNumber("");
      setAccountType(""); // Reset account type
      setError(""); // Clear any previous errors
    } catch (err) {
      setError(err.message);
      setSuccess(""); // Clear success message
    }
  };

  return (
    <div>
      <h2>Register</h2>
      {error && <p style={{ color: "red" }}>{error}</p>}
      {success && <p style={{ color: "green" }}>{success}</p>}
      <form onSubmit={handleRegister}>
        <div>
          <label>First Name:</label>
          <input
            type="text"
            value={fname}
            onChange={(e) => setFname(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Last Name:</label>
          <input
            type="text"
            value={lname}
            onChange={(e) => setLname(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Username:</label>
          <input
            type="text"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Phone Number:</label>
          <input
            type="text"
            value={phoneNumber}
            onChange={(e) => setPhoneNumber(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Account Type:</label>
          <select
            value={accountType}
            onChange={(e) => setAccountType(e.target.value)}
            required
          >
            <option value="">Select Account Type</option>
            <option value="personal">Personal</option>
            <option value="business">Business</option>
          </select>
        </div>
        <button type="submit">Register</button>
      </form>
    </div>
  );
};

export default Register;
